import React, { useState, useEffect } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import axios from 'axios';

const Sidebar = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const [users, setUsers] = useState([]);
    const userRole = localStorage.getItem('role'); // Check role from login session

    useEffect(() => {
        // Sirf admin ke liye users load karo
        if (userRole === 'admin') {
            axios.get('http://127.0.0.1:8000/api/admin/users')
                .then(res => setUsers(res.data))
                .catch(err => console.log("Users error"));
        }
    }, [userRole]);

    return (
        <div style={styles.sidebar}>
            {/* Logo Section */}
            <div style={{ textAlign: 'center', marginBottom: '40px' }}>
                <div style={styles.logoIcon}>üõ°Ô∏è</div>
                <h3 style={{ color: '#38bdf8', margin: 0 }}>DeepGuard</h3>
                <p style={{fontSize: '10px', color: '#64748b'}}>GOVERNANCE PORTAL</p>
            </div>

            {/* Menu Sections */}
            <div style={styles.label}>CORE WORKSPACE</div>
            <Link to="/dashboard" style={styles.navLink(location.pathname === '/dashboard')}>üìä Dashboard</Link>
            <Link to="/history" style={styles.navLink(location.pathname === '/history')}>üìú Forensic History</Link>

            {/* --- ADMIN ONLY SECTION --- */}
            {userRole === 'admin' && (
                <div style={{ marginTop: '30px', paddingBottom: '100px' }}>
                    <div style={styles.label}>IDENTITY MANAGEMENT</div>
                    
                    {/* Ye raha wo Assign Member Button */}
                    <Link to="/admin-panel" style={styles.assignBtn}>
                        ‚ûï Assign New Member
                    </Link>

                    <div style={styles.userListScroll}>
                        {users.map(u => (
                            <div key={u.user_id} style={styles.userRow}>
                                <div style={styles.dot(u.role)}></div>
                                <div style={{display: 'flex', flexDirection: 'column'}}>
                                    <span style={{fontSize: '12px', color: '#f8fafc'}}>{u.full_name}</span>
                                    <span style={{fontSize: '9px', color: '#38bdf8'}}>{u.role.toUpperCase()}</span>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            )}

            {/* Logout at the Bottom */}
            <div style={styles.footer}>
                <button onClick={() => { localStorage.clear(); navigate('/'); }} style={styles.logoutBtn}>
                    üö™ Exit System
                </button>
            </div>
        </div>
    );
};

const styles = {
    sidebar: { width: '260px', backgroundColor: '#0f172a', height: '100vh', padding: '20px', borderRight: '1px solid #1e293b', position: 'relative', display: 'flex', flexDirection: 'column', overflow: 'hidden' },
    logoIcon: { fontSize: '40px', marginBottom: '5px' },
    label: { fontSize: '10px', color: '#475569', letterSpacing: '1px', marginBottom: '15px', marginTop: '10px' },
    navLink: (active) => ({ display: 'block', padding: '12px', color: active ? '#38bdf8' : '#94a3b8', textDecoration: 'none', backgroundColor: active ? '#1e293b' : 'transparent', borderRadius: '10px', marginBottom: '5px' }),
    assignBtn: { display: 'block', textAlign: 'center', padding: '10px', backgroundColor: '#38bdf8', color: '#0f172a', textDecoration: 'none', borderRadius: '8px', fontWeight: 'bold', fontSize: '12px', marginBottom: '20px' },
    userListScroll: { maxHeight: '200px', overflowY: 'auto', paddingRight: '5px' },
    userRow: { display: 'flex', alignItems: 'center', gap: '10px', padding: '10px', backgroundColor: '#1e293b55', borderRadius: '10px', marginBottom: '8px', border: '1px solid #1e293b' },
    dot: (role) => ({ width: '8px', height: '8px', borderRadius: '50%', backgroundColor: role === 'admin' ? '#f59e0b' : '#38bdf8' }),
    footer: { position: 'absolute', bottom: '20px', left: '20px', right: '20px' },
    logoutBtn: { width: '100%', padding: '12px', border: '1px solid #ef4444', backgroundColor: '#ef444411', color: '#ef4444', borderRadius: '10px', cursor: 'pointer', fontWeight: 'bold' }
};

export default Sidebar;
